import axios from 'axios';
import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom'

function Read() {
    const {ID} = useParams();
    useEffect(()=> {
        axios.get('http://localhost:8081/'+ID)
        .then(res => console.log(res))
        .catch(err => console.log(err))
    }, [])
  return (
    <div>Read</div>
  )
}

export default Read
